import React from 'react';
import { Image, Container } from 'semantic-ui-react';

const ThanksPage = () => {
  return (
    <Container
      textAlign="center"
      style={{ margin: '2em', backgroundImage: `url(${'../utils/thankyou.png'})` }}
    >
      <Image src="../utils/thankyou.png" fluid />
    </Container>
  );
};

export default ThanksPage;
